import React from "react";
import BasicItemsPage from "./BasicItemsPage";

import mealImage from "../images/Burger_Fries.png";

const OrderPage = () => {
  return(
    <div>
      <BasicItemsPage displayInfo={displayInfo}/>
    </div>
  );
}

const displayInfo = [
  {
    title: "Meals",
    image: mealImage,
    url: "/meals"
  },
  {
    title: "Sides",
    image: mealImage,
    url: "/sides"
  },
  {
    title: "Drinks",
    image: mealImage,
    url: "/drinks"
  },
  {
    title: "Desserts",
    image: mealImage,
    url: "/desserts"
  }
];

export default OrderPage;
